const Buttons = () => {
  return (
    <div>
      <button className="btn btn-primary m-2">+</button>
      <button className="btn btn-primary">-</button>
      <button className="btn btn-primary">x</button>
      <button className="btn btn-primary">/</button>
    </div>
  );
};

export default Buttons;
